languages.text:
Славный Арнульф! Могучий Арнульф!{br}
Поступь его стометровые льды расколола.{br}
Топнув ногой Волку Морскому{br}
Врагов Всеотца на корм отдавал.{br}
Скьоль!{br}

Arnoolf the great! Arnoolf the glorious!{br}
His tread the ice cracking,{br}
Fifty fathoms deep.{br}
Heavy foot falling,{br}
The Allfather's foes sending{br}
To feed the Sea Wolf.{br}
Skal!{br}

